ckan.module('bs_popover', function($, _) {
	return {
		initialize : function() {
			var content = this.options.content;
			if (this.options.social_div_id) {
				var contentEl 	= $('#'+this.options.social_div_id);
				var newContent 	= contentEl.html();

				// commented out for the case when there are several 'share' buttons on the page
				// contentEl.remove();

				if ( newContent && newContent.length > 0 )
					content = newContent;
			}
			
			var popoverWrapper 	= document.body; 
			if (this.options.social_wrapper_div_id) {
				var tempPopoverWrapper	= $('#'+this.options.social_wrapper_div_id);
				if (tempPopoverWrapper) {
					popoverWrapper = tempPopoverWrapper;
					this.popoverWrapper	= tempPopoverWrapper;
				}
			}
			
			this.el.popover({
				trigger : this.options.trigger,
				placement : this.options.placement,
				content : content,
				title : this.options.title,
				html: true,
				container: popoverWrapper
			});
			
			this.el.on('click.bs_popover', $.proxy(this._onClick, this));
		},
		_onClick: function(e){
			this.el.popover("show");
			e.stopPropagation();
			$('html').on('click.bs_popover', $.proxy(this._onOtherClick, this));
		},
		_onOtherClick:  function(e) {
			this.el.popover("hide");
			$('html').off('click.bs_popover');
				
		},
//		_isVisible: function() {
//			var popoverDivEls	= this.popoverWrapper.find('.popover');
//			if (popoverDivEls && popoverDivEls.length > 0 )
//				return true;
//			
//			return false;
//		},
		options : {
			placement : 'top',
			trigger : 'manual',
			content : 'Empty !',
			title : 'No Title !',
			social_div_id : null,
			social_wrapper_div_id: null

		}
	};
});
this.ckan.module('confirm-ajax', function (jQuery, _) {
  return {
    /* An object of module options */
    options: {
      /* Locale options can be overidden with data-module-i18n attribute */
      i18n: {
        heading: _('Please Confirm Action'),
        content: _('Are you sure you want to perform this action?'),
        confirm: _('Confirm'),
        cancel: _('Cancel')
      },
      template: [
        '<div id="hdx-dataset" class="modal">',
        '<div class="modal-header">',
        '<button type="button" class="close" data-dismiss="modal"></button>',
        '<h3></h3>',
        '</div>',
        '<div class="modal-body"></div>',
        '<div class="modal-footer">',
        '<button class="btn btn-cancel"></button>',
        '<button class="btn btn-primary"></button>',
        '</div>',
        '</div>'
      ].join('\n')
    },

    /* Sets up the event listeners for the object. Called internally by
     * module.createInstance().
     *
     * Returns nothing.
     */
    initialize: function () {
      jQuery.proxyAll(this, /_on/);
      this.el.on('click', this._onClick);
    },

    /* Presents the user with a confirm dialogue to ensure that they wish to
     * continue with the current action.
     *
     * Examples
     *
     *   jQuery('.delete').click(function () {
     *     module.confirm();
     *   });
     *
     * Returns nothing.
     */
    confirm: function () {
      this.sandbox.body.append(this.createModal());
      this.modal.modal('show');

      // Center the modal in the middle of the screen.
      this.modal.css({
        'margin-top': this.modal.height() * -0.5,
        'top': '50%'
      });
    },

    /* Performs the action for the current item.
     *
     * Returns nothing.
     */
    performAction: function () {
      // create a form and submit it to confirm the deletion
      var form = jQuery('<a/>', {
        onClick: this.el.attr('data-ajax'),
      });
      form.appendTo('body').click();
      this.modal.modal('hide');
    },

    /* Creates the modal dialog, attaches event listeners and localised
     * strings.
     *
     * Returns the newly created element.
     */
    createModal: function () {
      if (!this.modal) {
        var element = this.modal = jQuery(this.options.template);
        element.on('click', '.btn-primary', this._onConfirmSuccess);
        element.on('click', '.btn-cancel', this._onConfirmCancel);
        element.modal({show: false});

        element.find('h3').text(this.i18n('heading'));
        element.find('.modal-body').text(this.i18n('content'));
        element.find('.btn-primary').text(this.i18n('confirm'));
        element.find('.btn-cancel').text(this.i18n('cancel'));
      }
      return this.modal;
    },

    /* Event handler that displays the confirm dialog */
    _onClick: function (event) {
      event.preventDefault();
      this.confirm();
    },

    /* Event handler for the success event */
    _onConfirmSuccess: function (event) {
      this.performAction();
    },

    /* Event handler for the cancel event */
    _onConfirmCancel: function (event) {
      this.modal.modal('hide');
    }
  };
});

